// Contactinfo.js

import './Contactinfo.css';

import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


import { faSave } from '@fortawesome/free-solid-svg-icons';



class Contactinfo extends React.Component {

    flipEditMode(propToChange) {
        console.log('Flip edit mode');
        let editModeOn = !propToChange.edit;
        propToChange.edit = editModeOn;
        console.log(editModeOn);
        console.log(this.props)
    }


    render () {
        console.log(this.props)
        let phoneNumber;
        if (this.props.phoneNumber.edit)
        {
            phoneNumber = <div >
                <input id="phoneNumber" placeholder={this.props.phoneNumber.value}></input>
                <FontAwesomeIcon icon={faSave}> 
                </FontAwesomeIcon>
                </div>
        }
        else
        {
            console.log('don\'t edit')
            phoneNumber =  <div><h3 id="phoneNumber" onClick={() => {this.flipEditMode(this.props.phoneNumber)}}>{this.props.phoneNumber.value}</h3></div>
        }
        console.log(phoneNumber)
    return (
        <div id="contact-info">
        {phoneNumber}
        </div>
        );

    }
}


// <h3 onClick={() => {this.flipEditMode(this.props.phoneNumber)}}> {this.props.phoneNumber.value} </h3>

export default Contactinfo;
